CREATE TABLE `customer_details` (
  `email_id` varchar(50) NOT NULL,
  `customer_ID` varchar(10) NOT NULL,
  `first_name` varchar(40) NOT NULL,
  `last_name` varchar(40) NOT NULL,
  `designation` varchar(40) NOT NULL,
  `password` varchar(40) NOT NULL,
  `organization_name` varchar(40) NOT NULL,
  `addressLine1` varchar(40) DEFAULT NULL,
  `addressLine2` varchar(40) DEFAULT NULL,
  `state` varchar(40) DEFAULT NULL,
  `country` varchar(40) NOT NULL,
  `city` varchar(40) NOT NULL,
  `pincode` bigint(20) DEFAULT NULL,
  `contactNumber` varchar(11) NOT NULL,
  `company_url` varchar(40) NOT NULL,
  `company_registration_number` varchar(40) NOT NULL,
  `retail_business_type` varchar(40) NOT NULL,
  `license_type` varchar(40) NOT NULL,
  `addressproof` varchar(40) NOT NULL,
  `address_proof` longblob,
  `language` varchar(40) NOT NULL,
  `servicetaxnumber` varchar(40) NOT NULL,
  `service_tax_number` longblob,
  `subscription_date` datetime NOT NULL,
  `valid_date` datetime NOT NULL,
  `status` varchar(40) NOT NULL,
  `business_details` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`email_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

